const Filter = () => {
  return (
    <div id="filterContainer">
         <div id="radioFilter">
              <input type='radio' name='group-1' value='ascending' /> <label> Ascending Name</label>
              <input type='radio' name='group-1' value='descending' /> <label> Descending Name</label>
         </div>
    </div>
  )
}

export default Filter
